import Link from "next/link";

function Nav() {
  return (
    <nav>
      <Link href="/">
        <a className="nav-link">Home</a>
      </Link>
      <Link href="/about">
        <a className="nav-link">About</a>
      </Link>
    </nav>
  );
}

export default Nav;
